import React, { useState } from 'react';
import { SQLExecuteResponse } from '../../types/api';
import './DataTable.css';

interface DataTableProps {
  data: SQLExecuteResponse | null;
  loading?: boolean;
  error?: string | null;
}

const DataTable: React.FC<DataTableProps> = ({ data, loading, error }) => {
  const [sortConfig, setSortConfig] = useState<{
    key: string;
    direction: 'asc' | 'desc';
  } | null>(null);

  // Calculate sorted data first (before early returns)
  const sortedData = React.useMemo(() => {
    if (!data || !data.data) return [];

    let sortableData = [...data.data];
    if (sortConfig !== null) {
      sortableData.sort((a, b) => {
        if (a[sortConfig.key] < b[sortConfig.key]) {
          return sortConfig.direction === 'asc' ? -1 : 1;
        }
        if (a[sortConfig.key] > b[sortConfig.key]) {
          return sortConfig.direction === 'asc' ? 1 : -1;
        }
        return 0;
      });
    }
    return sortableData;
  }, [data, sortConfig]);

  if (loading) {
    return (
      <div className="data-table-container">
        <div className="loading-state">Loading data...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="data-table-container">
        <div className="error-state">
          <h4>Error executing query</h4>
          <p>{error}</p>
        </div>
      </div>
    );
  }

  if (!data || !data.data || data.data.length === 0) {
    return (
      <div className="data-table-container">
        <div className="empty-state">
          <p>No data returned from query</p>
        </div>
      </div>
    );
  }

  const handleSort = (key: string) => {
    let direction: 'asc' | 'desc' = 'asc';
    if (sortConfig && sortConfig.key === key && sortConfig.direction === 'asc') {
      direction = 'desc';
    }
    setSortConfig({ key, direction });
  };

  const columns = Object.keys(data.data[0]);
  const columnTypes = data.columnTypes || {};

  return (
    <div className="data-table-container">
      <div className="table-header">
        <h3>Query Results</h3>
        <div className="table-stats">
          <span>{data.totalRows.toLocaleString()} rows</span>
          <span>${data.cost.toFixed(4)} cost</span>
          <span>{(data.bytesProcessed / 1024 / 1024).toFixed(2)} MB processed</span>
          <span>{data.executionTime.toFixed(2)}s execution</span>
        </div>
      </div>

      <div className="table-wrapper">
        <table className="data-table">
          <thead>
            <tr>
              {columns.map((column) => (
                <th 
                  key={column} 
                  onClick={() => handleSort(column)}
                  className={sortConfig?.key === column ? 'sorted' : ''}
                >
                  <div className="column-header">
                    <span>{column}</span>
                    <span className="column-type">{columnTypes[column]}</span>
                    {sortConfig?.key === column && (
                      <span className="sort-direction">
                        {sortConfig.direction === 'asc' ? '↑' : '↓'}
                      </span>
                    )}
                  </div>
                </th>
              ))}
            </tr>
          </thead>
          <tbody>
            {sortedData.map((row, index) => (
              <tr key={index} className={index % 2 === 0 ? 'even' : 'odd'}>
                {columns.map((column) => (
                  <td key={column}>
                    {row[column] === null ? (
                      <span className="null-value">NULL</span>
                    ) : (
                      String(row[column])
                    )}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {data.totalRows > 100 && (
        <div className="pagination-info">
          <p>Showing {sortedData.length} of {data.totalRows.toLocaleString()} rows</p>
        </div>
      )}
    </div>
  );
};

export default DataTable;
